function Match() {
    return(
        <div className="wrapper">
            <h2 className="p-4">Upload Excel Sheets</h2>

            <form className="form-group custom-form d-flex ms-4 me-4">
                <input type="file" className="form-control" required />
                <button type="submit" className="btn btn-success btn-md ps-2">Upload</button>
            </form>
        </div>
    )
}

export default Match;
